    false,nt"url": null,nt"notes": "This FY2015 progress report documents project
    activities for bird communities of coniferous forests in the Acadian Region. The
    goal of the project is to examine effects of forest harvest practices used in northern
    coniferous-dominated and mixed coniferous/deciduous stands across the Northern Forest
    region on diversity and abundance of the bird community, with an emphasis on selected
    species of conservation interest. The study will quantify bird communities in manipulated
    stands compared to reference stands and within the larger landscape context. Project
    goals, expected conservation outcomes, and the project status are outlined in this
    report.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
